import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Search for a product (e.g., "iPhone")
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_filled.png'));

    // Click the search button (first .search-btn)
    const searchBtn = await page.$('.search-btn');
    if (searchBtn) {
      await searchBtn.click();
    }
    // Wait for search results (look for "Search Results" heading)
    await page.waitForSelector('text=Search Results', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Find the first product card containing "iPhone" and click it
    const productCard = await page.waitForSelector('//div[contains(@class,"product-card")]//h3[contains(text(),"iPhone")]/ancestor::div[contains(@class,"product-card")]', { timeout: 5000 });
    await productCard.click();

    // Wait for the product detail modal to appear (look for "Add to Wish List" button)
    await page.waitForSelector('button.add-to-wishlist', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_product_detail.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_product_detail.png'));

    // Click the "Add to Wish List" button
    await page.click('button.add-to-wishlist');
    // Wait for notification that confirms addition to wishlist
    await page.waitForSelector('.notification.success', { timeout: 5000 });
    // Extract notification text
    const notificationText = await page.textContent('.notification.success');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_added_to_wishlist.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_added_to_wishlist.png'));

    // Go to the wishlist page (click "Your Wish List" link)
    // There are multiple, pick the first visible
    const wishListLink = await page.$('//a[contains(text(),"Your Wish List")]');
    if (wishListLink) {
      await wishListLink.click();
    }
    // Wait for wishlist page to load
    await page.waitForSelector('h2:text("Your Wish List")', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_wishlist_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_wishlist_page.png'));

    // Extract wishlist items
    const wishlistItems = await page.$$eval('.wishlist-title', els => els.map(e => e.textContent.trim()));

    return {
      success: true,
      action: "Searched for a product, added it to wishlist, and verified it appears in the wishlist.",
      extractedData: {
        notification: notificationText,
        wishlistItems
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
